import React from 'react';
import './final.css';

const Final = () => { 
  return (
    <div className='main-container'>
      <span className='text'>WHAT NEXT ...</span>
      <div className='box'>
        <div className='box-2'>
          <span className='text-2'>
            We will send you an email on <br />
          1st Feb</span>
          <span className='text-7'>for Your match</span>
        </div>
        <div className='wrapper'>
          <span className='text-8'>Your Gmail</span>
        </div>
      </div>
    </div>
  );
}
export default Final;
